    @outdoor_air_method.setter
    def outdoor_air_method(self, value="Flow/Person"):
        """  Corresponds to IDD Field `Outdoor Air Method`
        Flow/Person, Flow/Zone, Flow/Area, Sum, and Maximum use the values in the next three
        fields: Outdoor Air Flow Rate per Person, Outdoor Air Flow Rate per Zone Floor Area,
        and Outdoor Air Flow Rate per Zone.
        DetailedSpecification ignores these three Outdoor Air Flow Rate fields and instead
        references design specification objects named in the fields
        Design Specification Outdoor Air Object Name and Design Specification Zone Air
        Distribution Object Name.

        Args:
            value (str): value for IDD Field `Outdoor Air Method`
                Accepted values are:
                      - Flow/Person
                      - Flow/Zone
                      - Flow/Area
                      - Sum
                      - Maximum
                      - DetailedSpecification
                Default value: Flow/Person
                if `value` is None it will not be checked against the
                specification and is assumed to be a missing value

        Raises:
            ValueError: if `value` is not a valid value
        """
        if value is not None:
            try:
                value = str(value)
            except ValueError:
                raise ValueError('value {} need to be of type str'
                                 ' for field `HvactemplateZonePtac.outdoor_air_method`'.format(value))
            if ',' in value:
                raise ValueError('value should not contain a comma '
                                 'for field `HvactemplateZonePtac.outdoor_air_method`')
            if '!' in value:
                raise ValueError('value should not contain a ! '
                                 'for field `HvactemplateZonePtac.outdoor_air_method`')
            vals = {}
            vals["flow/person"] = "Flow/Person"
            vals["flow/zone"] = "Flow/Zone"
            vals["flow/area"] = "Flow/Area"
            vals["sum"] = "Sum"
            vals["maximum"] = "Maximum"
            vals["detailedspecification"] = "DetailedSpecification"
            value_lower = value.lower()
            if value_lower not in vals:
                found = False
                if not self.strict:
                    for key in vals:
                        if key in value_lower or value_lower in key:
                            value_lower = key
                            found = True
                            break
                    if not found:
                        value_stripped = re.sub(r'[^a-zA-Z0-9]', '', value_lower)
                        for key in vals:
                            key_stripped = re.sub(r'[^a-zA-Z0-9]', '', key)
                            if key_stripped == value_stripped:
                                value_lower = key
                                found = True
                                break
                if not found:
                    raise ValueError('value {} is not an accepted value for '
                                     'field `HvactemplateZonePtac.outdoor_air_method`'.format(value))
                else:
                    logger.warn('change value {} to accepted value {} for '
                                 'field `HvactemplateZonePtac.outdoor_air_method`'.format(value, vals[value_lower]))
            value = vals[value_lower]
        self._data["Outdoor Air Method"] = value

