    @system_configuration_type.setter
    def system_configuration_type(self, value="SingleFanConstantVolume"):
        """  Corresponds to IDD Field `System Configuration Type`
        SingleFan - a single supply fan before the split to dual ducts
        DualFan - two supply fans, one each for the cold and hot ducts
        ConstantVolume - constant volume
        VariableVolume - variable volume

        Args:
            value (str): value for IDD Field `System Configuration Type`
                Accepted values are:
                      - SingleFanConstantVolume
                      - DualFanConstantVolume
                      - SingleFanVariableVolume
                      - DualFanVariableVolume
                Default value: SingleFanConstantVolume
                if `value` is None it will not be checked against the
                specification and is assumed to be a missing value

        Raises:
            ValueError: if `value` is not a valid value
        """
        if value is not None:
            try:
                value = str(value)
            except ValueError:
                raise ValueError('value {} need to be of type str'
                                 ' for field `HvactemplateSystemDualDuct.system_configuration_type`'.format(value))
            if ',' in value:
                raise ValueError('value should not contain a comma '
                                 'for field `HvactemplateSystemDualDuct.system_configuration_type`')
            if '!' in value:
                raise ValueError('value should not contain a ! '
                                 'for field `HvactemplateSystemDualDuct.system_configuration_type`')
            vals = {}
            vals["singlefanconstantvolume"] = "SingleFanConstantVolume"
            vals["dualfanconstantvolume"] = "DualFanConstantVolume"
            vals["singlefanvariablevolume"] = "SingleFanVariableVolume"
            vals["dualfanvariablevolume"] = "DualFanVariableVolume"
            value_lower = value.lower()
            if value_lower not in vals:
                found = False
                if not self.strict:
                    for key in vals:
                        if key in value_lower or value_lower in key:
                            value_lower = key
                            found = True
                            break
                    if not found:
                        value_stripped = re.sub(r'[^a-zA-Z0-9]', '', value_lower)
                        for key in vals:
                            key_stripped = re.sub(r'[^a-zA-Z0-9]', '', key)
                            if key_stripped == value_stripped:
                                value_lower = key
                                found = True
                                break
                if not found:
                    raise ValueError('value {} is not an accepted value for '
                                     'field `HvactemplateSystemDualDuct.system_configuration_type`'.format(value))
                else:
                    logger.warn('change value {} to accepted value {} for '
                                 'field `HvactemplateSystemDualDuct.system_configuration_type`'.format(value, vals[value_lower]))
            value = vals[value_lower]
        self._data["System Configuration Type"] = value

